import { MenuProps, SECTION } from "../App";
import { AceClubs } from "../icons/AceClubs";
import { ConnectionsIcon } from "../icons/ConnectionsIcon";
import { KingSpades } from "../icons/KingSpades";
import { MiniIcon } from "../icons/MiniIcon";
import { SpellingBeeIcon } from "../icons/SpellingBeeIcon";
import { StrandsIcon } from "../icons/StrandsIcon";
import "../styles/menu.css";

export default function Menu({ section, setSection }: MenuProps) {
  return (
    <div className="menu-container">
      <div className="menu">
        <div
          className="game-card"
          onClick={() => setSection(SECTION.CONNECTIONS)}
        >
          {AceClubs}
        </div>
        <div className="game-card" onClick={() => setSection(SECTION.STRANDS)}>
          {KingSpades}
        </div>
        <div className="game-card" onClick={() => setSection(SECTION.VERTEX)}>
          {SpellingBeeIcon}
        </div>
        <div className="game-card" onClick={() => setSection(SECTION.MINI)}>
          {MiniIcon}
        </div>
      </div>
    </div>
  );
}
